  1→const { app, BrowserWindow, shell } = require("electron");
  2→const { spawn } = require("child_process");
  3→const path = require("path");
  4→const fs = require("fs");
  5→const net = require("net");
  6→const log = require("electron-log/main");
  7→const { setupIPC } = require("./ipc-handlers");
  8→
  9→// --- Logging setup ---
 10→
 11→const LOG_DIR = path.join(require("os").homedir(), ".claude-for-beginners", "logs");
 12→fs.mkdirSync(LOG_DIR, { recursive: true });
 13→
 14→log.initialize();
 15→log.transports.file.resolvePathFn = () => path.join(LOG_DIR, "electron.log");
 16→log.transports.file.maxSize = 5 * 1024 * 1024; // 5 MB per file
 17→log.transports.file.format = "[{y}-{m}-{d} {h}:{i}:{s}.{ms}] [{level}] {text}";
 18→// electron-log auto-rotates: keeps electron.log + electron.old.log
 19→
 20→// Override console so all console.log/error also go to file
 21→Object.assign(console, log.functions);
 22→
 23→log.info("=== Claude for Beginners starting ===");
 24→log.info("Platform:", process.platform, process.arch);
 25→log.info("Electron:", process.versions.electron);
 26→log.info("Node:", process.versions.node);
 27→log.info("App path:", app.getAppPath());
 28→log.info("Log file:", log.transports.file.getFile().path);
 29→
 30→// --- State ---
 31→
 32→let mainWindow = null;
 33→let nextServer = null;
 34→
 35→// --- Next.js server management ---
 36→
 37→function getRandomPort() {
 38→  return new Promise((resolve, reject) => {
 39→    const server = net.createServer();
 40→    server.listen(0, "127.0.0.1", () => {
 41→      const addr = server.address();
 42→      if (addr && typeof addr === "object") {
 43→        const port = addr.port;
 44→        server.close(() => resolve(port));
 45→      } else {
 46→        reject(new Error("Failed to get port"));
 47→      }
 48→    });
 49→    server.on("error", reject);
 50→  });
 51→}
 52→
 53→async function startNextServer() {
 54→  const port = await getRandomPort();
 55→  log.info("Starting Next.js standalone server on port", port);
 56→
 57→  const standalonePath = path.join(app.getAppPath(), ".next", "standalone", "server.js");
 58→  nextServer = spawn(process.execPath, [standalonePath], {
 59→    env: {
 60→      ...process.env,
 61→      PORT: String(port),
 62→      HOSTNAME: "127.0.0.1",
 63→    },
 64→    stdio: "pipe",
 65→  });
 66→
 67→  nextServer.stdout?.on("data", (data) => {
 68→    log.info("[next]", data.toString().trim());
 69→  });
 70→
 71→  nextServer.stderr?.on("data", (data) => {
 72→    log.warn("[next]", data.toString().trim());
 73→  });
 74→
 75→  nextServer.on("error", (err) => {
 76→    log.error("[next] Failed to start:", err.message);
 77→  });
 78→
 79→  nextServer.on("close", (code) => {
 80→    log.info("[next] Process exited with code", code);
 81→  });
 82→
 83→  // Wait for server to be ready
 84→  await new Promise((resolve) => {
 85→    const check = () => {
 86→      const req = net.createConnection({ port, host: "127.0.0.1" }, () => {
 87→        req.end();
 88→        resolve();
 89→      });
 90→      req.on("error", () => {
 91→        setTimeout(check, 200);
 92→      });
 93→    };
 94→    check();
 95→  });
 96→
 97→  log.info("Next.js server ready on port", port);
 98→  return port;
 99→}
100→
101→// --- Window management ---
102→
103→function createWindow(port) {
104→  const isMac = process.platform === "darwin";
105→  log.info("Creating window, loading http://127.0.0.1:" + port);
106→
107→  mainWindow = new BrowserWindow({
108→    width: 1280,
109→    height: 860,
110→    minWidth: 900,
111→    minHeight: 600,
112→    icon: path.join(__dirname, "..", "public", "icon.png"),
113→    titleBarStyle: isMac ? "hiddenInset" : "default",
114→    trafficLightPosition: isMac ? { x: 16, y: 16 } : undefined,
115→    backgroundColor: "#FFD700",
116→    webPreferences: {
117→      preload: path.join(__dirname, "preload.js"),
118→      contextIsolation: true,
119→      nodeIntegration: false,
120→      webviewTag: true,
121→    },
122→    show: false,
123→  });
124→
125→  mainWindow.loadURL(`http://127.0.0.1:${port}`);
126→
127→  mainWindow.once("ready-to-show", () => {
128→    log.info("Window ready to show");
129→    mainWindow.show();
130→    if (!app.isPackaged) {
131→      mainWindow.webContents.openDevTools();
132→    }
133→  });
134→
135→  mainWindow.webContents.on("did-fail-load", (_event, errorCode, errorDescription) => {
136→    log.error("Window failed to load:", errorCode, errorDescription);
137→  });
138→
139→  mainWindow.webContents.on("did-finish-load", () => {
140→    log.info("Window finished loading");
141→  });
142→
143→  // Open external links in default browser
144→  mainWindow.webContents.setWindowOpenHandler(({ url }) => {
145→    log.info("Opening external URL:", url);
146→    shell.openExternal(url);
147→    return { action: "deny" };
148→  });
149→
150→  mainWindow.on("closed", () => {
151→    log.info("Window closed");
152→    mainWindow = null;
153→  });
154→}
155→
156→// --- App lifecycle ---
157→
158→app.whenReady().then(async () => {
159→  setupIPC();
160→
161→  const isDev = !app.isPackaged;
162→  log.info("Dev mode:", isDev);
163→
164→  // In dev, Next.js runs externally via concurrently on port 3456
165→  const port = isDev ? 3456 : await startNextServer();
166→
167→  createWindow(port);
168→
169→  app.on("activate", () => {
170→    if (BrowserWindow.getAllWindows().length === 0) {
171→      log.info("Reactivating — creating new window");
172→      createWindow(port);
173→    }
174→  });
175→});
176→
177→app.on("window-all-closed", () => {
178→  log.info("All windows closed");
179→  if (process.platform !== "darwin") {
180→    app.quit();
181→  }
182→});
183→
184→app.on("before-quit", () => {
185→  log.info("=== App quitting ===");
186→  if (nextServer) {
187→    log.info("Killing Next.js server");
188→    nextServer.kill();
189→    nextServer = null;
190→  }
191→});
