 1→import ElectronStore from "electron-store";
 2→
 3→const schema = {
 4→  projects: {
 5→    type: "array",
 6→    default: [],
 7→    items: {
 8→      type: "object",
 9→      properties: {
10→        id: { type: "string" },
11→        name: { type: "string" },
12→        displayName: { type: "string" },
13→        path: { type: "string" },
14→        createdAt: { type: "string" },
