19→        audience: { type: ["string", "null"] },
20→        priority: { type: ["string", "null"] },
21→        designRef: { type: ["string", "null"] },
22→        liveUrl: { type: ["string", "null"] },
23→        githubUrl: { type: ["string", "null"] },
24→      },
25→    },
26→  },
27→  activeProjectId: {
28→    type: ["string", "null"],
29→    default: null,
30→  },
31→};
32→
33→const store = new ElectronStore({
34→  name: "cc4d-projects",
35→  schema,
36→});
37→
38→export function getProjects() {
39→  return store.get("projects", []);
40→}
41→
42→export function getProject(id) {
43→  const projects = getProjects();
44→  return projects.find((p) => p.id === id) || null;
45→}
46→
47→export function addProject(meta) {
48→  const projects = getProjects();
49→  projects.push(meta);
50→  store.set("projects", projects);
51→  store.set("activeProjectId", meta.id);
52→}
53→
54→export function updateProject(id, updates) {
55→  const projects = getProjects();
56→  const idx = projects.findIndex((p) => p.id === id);
57→  if (idx === -1) return null;
58→  projects[idx] = { ...projects[idx], ...updates };
59→  store.set("projects", projects);
60→  return projects[idx];
61→}
62→
63→export function removeProject(id) {
64→  const projects = getProjects();
65→  store.set(
66→    "projects",
67→    projects.filter((p) => p.id !== id)
68→  );
69→  const activeId = store.get("activeProjectId");
70→  if (activeId === id) {
71→    store.set("activeProjectId", null);
72→  }
73→}
