 4→const STOP_WORDS = new Set([
 5→  // English
 6→  "a", "an", "the", "for", "my", "our", "website", "site", "page", "web",
 7→  "want", "build", "create", "make", "need", "like", "would", "about",
 8→  "that", "this", "with", "and", "but", "just", "some", "very",
 9→  // Hebrew
10→  "של", "אתר", "עמוד", "דף", "אני", "שלי", "בשביל", "לי", "את", "עם",
11→  "רוצה", "לבנות", "ליצור", "משהו", "זה", "הוא", "היא", "גם", "אבל", "רק",
12→]);
