14→function slugifyIdea(idea) {
15→  // Transliterate Hebrew to nothing (strip it), keep ASCII
16→  const ascii = idea
17→    .toLowerCase()
18→    .replace(/[^\x00-\x7F]/g, " ") // strip non-ASCII (Hebrew etc.)
19→    .replace(/[^a-z0-9\s-]/g, "")  // keep letters, digits, spaces, hyphens
20→    .trim();
21→
22→  const words = ascii
23→    .split(/\s+/)
24→    .filter((w) => w && !STOP_WORDS.has(w));
25→
26→  const slug = words.slice(0, 3).join("-") || "my-project";
27→  return slug;
28→}
29→
30→async function deduplicatePath(baseDir, slug) {
31→  let name = slug;
32→  let counter = 1;
33→  while (fs.existsSync(path.join(baseDir, name))) {
34→    counter++;
35→    name = `${slug}-${counter}`;
36→  }
37→  return name;
38→}
39→
40→module.exports = { STOP_WORDS, slugifyIdea, deduplicatePath };
